    function findDifference(SK, IWA)
    {

        var difference = [];

        for (var i = 0; i < IWA.length; i++) {

            for (var j = 0; j < SK.length; j++) {

                if (SK[j].name != IWA[i].name) {

                    difference.push(SK.name);
                }

            }

        }

        return difference;

    }


